<?phpnamespace App\Entity;class Organ{    private $id;    private $name;    private $age;    private $price;    private $picture;// etc.    public function setName(string $name)    {        $this->name = $name;    }    public function getName()    {        return $this->name;    }    public function setId(int $id)    {        $this->id = $id;    }    public function getId()    {        return $this->id;    }    public function setPrice(int $price)    {        $this->price = $price;    }    public function getPrice()    {        return $this->price;    }    public function setAge(int $age)    {        $this->age = $age;    }    public function getAge()    {        return $this->age;    }// etc.    public function setPicture(string $picture)    {        $this->picture = $picture;    }    public function getPicture()    {        return $this->picture;    }}